E_D("replace into `phome_ecms_news_data_1` values('743','44','1702,1701,1700,174,175,169,542,1672,1671,1670','1','0','0','0','','','','<p><span style=\\\\\"font-size: 14px\\\\\"><strong>哈德逊在全球</strong></span></p>\r\n<p style=\\\\\"text-align: center\\\\\"><img alt=\\\\\"意大利.jpg\\\\\" width=\\\\\"550\\\\\" height=\\\\\"413\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-08/a7721f815aa4c1ee3dbdd19a06b1559f.jpg\\\\\" /></p>\r\n<p style=\\\\\"text-align: center\\\\\"><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2014年哈德逊参加了意大利博洛尼亚陶瓷展</span></span></p>\r\n<div><span style=\\\\\"font-size: 10.5pt\\\\\">　　意大利博洛尼亚国际建材展(SAIE)，是世界知名的建材和室内装饰展会，是久负盛名的欧洲三大国际建筑博览会之一，至今已创办46年。每年一届的博洛尼亚国际建材展已经成为业内最专业的博览会，作为欧洲乃至全球首屈一指的的建筑博览会，意大利建材展每年都吸引来自欧洲及国际近二十万专业人士到此，2010年才允许中国企业参展。</span></div>\r\n<div style=\\\\\"text-align: center\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"新加坡.jpg\\\\\" width=\\\\\"550\\\\\" height=\\\\\"365\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-14/bfde612819333fdc927e6e16ecb04b52.jpg\\\\\" /></span></div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">　　</span><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2013年哈德逊参加第12届亚洲(新加坡)国际绿色建筑展览会</span></span></div>\r\n<div>&nbsp;</div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"俄罗斯.jpg\\\\\" width=\\\\\"552\\\\\" height=\\\\\"414\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-08/8b3cb7e07366bf111ea1e01cbffa6df3.jpg\\\\\" /></span></div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">　　</span><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2013年哈德逊参加俄罗斯莫斯科国际建材展会</span></span></div>\r\n<div><span style=\\\\\"color: #0000ff\\\\\">&nbsp;</span>&nbsp;</div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"美国.jpg\\\\\" width=\\\\\"550\\\\\" height=\\\\\"447\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-14/7fc9a39918293ac4704bedcedc277511.jpg\\\\\" /></span></div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">　　</span><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2013年哈德逊参加美国国际瓷砖、石材展览会</span></span></div>\r\n<div><span style=\\\\\"font-size: 10.5pt\\\\\">　　美国国际石材及瓷砖博览会是美国最大的石材、瓷砖和地铺材料专业展会，每年一届。2013年的美国Coverings石材展在美国亚特兰大举行，展出面积近27,000平方米，共有来自全球30多个国家的900多名名陶瓷、石材生产厂商和贸易公司参加此次盛会。展览期间共吸引来自包括意大利、德国、巴西、阿根廷、土耳其和中国在内的数十个国家的专业观众达37,000余名。</span></div>\r\n<div>&nbsp;</div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"巴西圣保罗.jpg\\\\\" width=\\\\\"552\\\\\" height=\\\\\"414\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-08/ab4e3842dafd833803fe862b4aecc78d.jpg\\\\\" /></span></div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">　　</span><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2012、2013年哈德逊参加巴西圣保罗国际建材展</span></span></div>\r\n<div><span style=\\\\\"font-size: 10.5pt\\\\\">　　巴西圣保罗国际建材展FEICON&nbsp;BATIMAT首次举办于1990年，是世界第四大综合建材展览会，可谓是国际上关于建筑领域最新产品和技术的最佳展示地。，如今该博览会已被认为是南美地区规模最大最具影响力的综合建材展。每年到场的参展者包括世界各地建筑师、设计师、工程师以及众多的建材产品零售商及建筑贸易专业人士等。</span></div>\r\n<div>&nbsp;</div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"澳大利亚2.jpg\\\\\" width=\\\\\"550\\\\\" height=\\\\\"413\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-14/4a0c9797054ecc2008376e6daf86f0f9.jpg\\\\\" /></span></div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">　　</span><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2012年哈德逊参加澳大利亚国际建材及家居用品展览会</span></span></div>\r\n<div style=\\\\\"text-align: center\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"color: #ff6600\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"迪拜.jpg\\\\\" width=\\\\\"552\\\\\" height=\\\\\"414\\\\\" src=\\\\\"/d/file/zjhdx/2015-01-08/7da3ea6e645a51f9f0fe13e564e6da54.jpg\\\\\" /></span></span></div>\r\n<div style=\\\\\"text-align: center\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">　　</span><span style=\\\\\"color: #0000ff\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">2012年哈德逊参加中东迪拜五大行业展</span></span></div>\r\n<div><span style=\\\\\"font-size: 10.5pt\\\\\">　　中东迪拜国际五大行业展览会The&nbsp;Big&nbsp;5始办于1980年的中东迪拜五大行业展(BIG5)是中东地区具影响力且是最大型的建筑、建材及服务类展览会。同时其衍生展中东五大行业建筑机械、车辆及设备展览会(BIG　5PMV)是专注于中东地区建筑设备、机械、工具和车辆的专业展会。</span></div>');");
